import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 51.1-1210 Administrative fee for rejoining the Fund.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/51.1-1210.md","filePath":"vacode/51.1-1210.md"}'),r={name:"vacode/51.1-1210.md"},n=i('<h1 id="§-51-1-1210-administrative-fee-for-rejoining-the-fund" tabindex="-1">§ 51.1-1210 Administrative fee for rejoining the Fund. <a class="header-anchor" href="#§-51-1-1210-administrative-fee-for-rejoining-the-fund" aria-label="Permalink to &quot;§ 51.1-1210 Administrative fee for rejoining the Fund.&quot;">​</a></h1><p>Any individual who had been a member of the Fund and who applies to rejoin the Fund shall not be entitled to membership until he has paid an administrative fee of twenty-five dollars. The Board shall elect to waive the twenty-five dollar fee for members reinstated pursuant to subsection B in § <a href="http://law.lis.virginia.gov/vacode/51.1-1209/" target="_blank" rel="noreferrer">51.1-1209</a>.</p><p>1999, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0664" target="_blank" rel="noreferrer">664</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0349" target="_blank" rel="noreferrer">349</a>.</p>',3),o=[n];function l(s,d,f,h,c,_){return t(),a("div",null,o)}const v=e(r,[["render",l]]);export{g as __pageData,v as default};
